import React from 'react';
import ButtonLinkNotMouse from './ButtonLinkNotMouse';
import hoverDescription from '../../../hoc/hoverDescription';

function ButtonLinkHOC (props){
    
    return(
           
        <ButtonLinkNotMouse 
            classname={props.classname}
            onclick={props.onclick}
            to={props.to}
            name={props.name}
        />
    )
}

export default ButtonLinkHOC
